import React from 'react';
import ReactDOM from 'react-dom/client';
import DrawBtn from './DrawBtn';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
	<React.StrictMode>
		<div className="centeredContainer">
			<h1>Draw Stuff</h1>
		</div>
		<div className="centeredContainer">
			<DrawBtn />
		</div>
	</React.StrictMode>
);
